import React from 'react';
import {useState,useEffect} from 'react';

function App() {

  const [user,setUser] = useState([]);


  useEffect(() => {
    getFetch();
  },[user])


  const getFetch = () => {
   try {
    const data = "http://localhost:8080/sign/all";
    fetch(data)
      .then(result => {
        let content = result.json();
        console.log(content);
        setUser(content);
      })
      .catch(err => console.log(err));
   } catch (error) {
      console.log(error);
   }
  }


  return (
    <div>
      {user}
    </div>
  )
}

export default App
